# Solution profile
num_methods = 5
num_instances = 1000
times_combined = [[0 for m in range(num_methods)] for i in range(num_instances)]
time_values = np.concatenate([np.linspace(0.5,0.99,num=10),np.logspace(0.0,math.log10(200),num=1000)])
for i in range(num_instances):
    times_combined[i][0] = alpine_default_20[i]
    times_combined[i][1] = alpine_sp_20[i]
    times_combined[i][2] = alpine_ab_20[i]
    times_combined[i][3] = alpine_sp_4pts_20[i]
    times_combined[i][4] = alpine_ab_4pts_20[i]
methods = ['Default', 'SP2', 'ML2', 'SP4', 'ML4']
solution_profile(times_combined, methods, time_values, "bilinear_20_solution_profile", r'$n = 20$')





